pragma solidity ^0.5.2;

import "./interfaces/IRegistry.sol";
import "./interfaces/IWhitelist.sol";

contract Ballot {
  IRegistry private registry;
  IWhitelist private whitelist;

  event Voted(address voter);

  mapping(address => uint) votes;

  constructor(address _registryAddress)
    public
  {
    require(_registryAddress != address(0), "Address not real");
    registry = IRegistry(_registryAddress);
  }

  modifier isWhitelisted(address _address)
  {
    whitelist = IWhitelist(registry.getContractAddress("Whitelist"));
    require(whitelist.whitelisted(msg.sender), "Voter not registered to vote");
    _;
  }


  function vote()
    public
    isWhitelisted(msg.sender)
  {
    votes[msg.sender]++;

    // setTo!Whitelisted(msg.sender)

    emit Voted(msg.sender);
  }
}
